function LinkButtonList() {
  return (
    <div className="button-link-container">
      <LinkButton
        streamingService="SPOTIFY"
        streamingServiceLogo="/img/spotify.png"
      />
      <LinkButton
        streamingService="APPLE MUSIC"
        streamingServiceLogo="/img/apple.png"
      />
      <LinkButton
        streamingService="DEEZER"
        streamingServiceLogo="/img/deezer-small.png"
      />

      <style jsx>{`

        }
      `}</style>
    </div>
  );
}

export default LinkButtonList;
